def is_monotonic(arr):
    # Initialize two pointers
    i, j = 0, len(arr) - 1

    # Check if it is monotonically increasing
    if arr[i] < arr[j]:
        while i < len(arr) - 1:
            if arr[i+1] <= arr[i]:
                return False
            i += 1
        return True

    # Check if it is monotonically decreasing
    while i < len(arr) - 1:
        if arr[i+1] >= arr[i]:
            return False
        i += 1
    return True
